import React from 'react';
import '../../normalize.scss';
import '../../base.scss';
import CodigoConfirmacaoRecSenha from '../../components/RecuperaSenha/CodConfirmRecSenha';
import View from "../view/view"

const CodigoConfirmRecSenha = () => (
  <React.Fragment>
      <View public={true}>
          <CodigoConfirmacaoRecSenha />
      </View>
    </React.Fragment>
); 

export default CodigoConfirmRecSenha;
